import './App.css';

class App extends React.Component{

  state = {
    user:null,
  }

  setUserInState = (incomingUserData) => {
    this.setState({ user: incomingUserData})
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>GuyBean Coming Soon...</h1>
        </header>
      </div>
    );
  }
}

export default App;
